import React from "react";
import Navbar from "../HomePage/Navbar";
import "./DoctorSearchPage.css"; // Common CSS for this whole page

const DoctorSearchNavbar = ({ onSearch, defaultLocation = "", defaultSpecialization = "" }) => {
  const [location, setLocation] = React.useState(defaultLocation);
  const [specialization, setSpecialization] = React.useState(defaultSpecialization);

  const handleSubmit = (e) => {
    e.preventDefault();
    onSearch(location, specialization);
  };

  return (
    <div>
      <Navbar />
      <div className="search-container">
        <form className="search-box" onSubmit={handleSubmit}>
          <input
            type="text"
            placeholder="Location"
            value={location}
            onChange={(e) => setLocation(e.target.value)}
          />
          <input
            type="text"
            placeholder="Specialization"
            value={specialization}
            onChange={(e) => setSpecialization(e.target.value)}
          />
          <button type="submit">Search</button>
        </form>
      </div>
    </div>
  );
};

export default DoctorSearchNavbar;
